  `id_key` int(11) NOT NULL AUTO_INCREMENT,
  `promotion_id` int(11) NOT NULL COMMENT '促销活动id',
  `total` int(8) NOT NULL COMMENT '优惠数量',
  `remain` int(8) NOT NULL COMMENT '剩下的优惠数量',
  `start_dt` datetime DEFAULT NULL COMMENT '优惠券生效时间',
  `end_dt` datetime DEFAULT NULL COMMENT '优惠券结束时间',
  `type` int(1) DEFAULT NULL COMMENT '优惠类型，1.红包，2.兑换券(兑换物品) 3.满立减；4满立送；5.满返红包 6满返兑换券',
  `value` varchar(20) DEFAULT NULL COMMENT '对应type的值',
  `goods_id` int(11) DEFAULT NULL COMMENT '抵用的商品，暂时没用',
  `coupon_category` int(11) DEFAULT NULL COMMENT '抵用的商品目录，暂时没用',
  `coupon_min_money` decimal(14,0) DEFAULT NULL COMMENT '抵用的最小金额，暂时没用',
