  `one_max_use` int(4) NOT NULL COMMENT '一次最多使用多少张',
  `use_with_others` varchar(20) NOT NULL COMMENT '10.与任何活动都可以共用(优先级最高)；20.与本次(活动id一致)共用；30.不与任何活动共用；',
  `remarks` varchar(500) DEFAULT NULL COMMENT '优惠券使用备注',
