-- ----------------------------
-- Function structure for queryChildrenCategory
-- ----------------------------
DROP FUNCTION IF EXISTS `queryChildrenCategory`;
DELIMITER ;;
CREATE DEFINER=`dnake`@`%` FUNCTION `queryChildrenCategory`(`categoryId` int) RETURNS varchar(4000) CHARSET utf8
BEGIN
	DECLARE sTemp VARCHAR(4000);
	DECLARE sTempChd VARCHAR(4000);

	SET sTemp = '$';
	SET sTempChd = cast(categoryId as char);

	WHILE sTempChd is not NULL DO
		SET sTemp = CONCAT(sTemp,',',sTempChd);
		SELECT group_concat(id_key) INTO sTempChd FROM biz_category where FIND_IN_SET(parent_id,sTempChd)>0;
	END WHILE;
	return sTemp;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for queryChildrenDept
-- ----------------------------
DROP FUNCTION IF EXISTS `queryChildrenDept`;
DELIMITER ;;
CREATE DEFINER=`dnake`@`%` FUNCTION `queryChildrenDept`(`deptId` int) RETURNS varchar(4000) CHARSET utf8
BEGIN
	DECLARE sTemp VARCHAR(4000);
	DECLARE sTempChd VARCHAR(4000);

	SET sTemp = '$';
	SET sTempChd = cast(deptId as char);

	WHILE sTempChd is not NULL DO
		SET sTemp = CONCAT(sTemp,',',sTempChd);
		SELECT group_concat(id_key) INTO sTempChd FROM sys_dept where FIND_IN_SET(parent_id,sTempChd)>0;
	END WHILE;
	return sTemp;
END
;;
DELIMITER ;
