INSERT INTO `biz_note` VALUES ('50', '10', '这几天作为面试官的面试见闻，给大家参考或娱乐', '76', '最近我们公司要招的人比较多，每天都要面上两三个人，从刚实习完的到工作了几年的都有。\r\n\r\n\r\n我是个不爱照搬考题面试的人，就喜欢直接聊到哪算哪，一般过程是这样的：\r\n\r\n\r\n1、先介绍下过去做过的项目，负责哪些模块。\r\n这块一般会被当成开场白，因为泛泛介绍一下以后通常还会深入探讨细节。不过有一个人例外，他直接在这个阶段就打动我了。\r\n他当时除了介绍他的项目和模块是干嘛的，还拿张纸给我画了他们的代码业务流程图，从哪个模块调用哪个模块，哪个系统调用哪个系统，先做什么再做什么，还包括了如果哪步出问题，他们是怎么处理的，有条有理，思维严谨，虽然没有涉及什么高级技术，我当时就下定决心这个人要了。后来入职的半个月也充分证明了这是我最正确的选择之一，他总能提前干完还一直缠着问还有没有活干了，比很多老员工效率要高。', '2015-07-13 15:26:57', '2014-09-23 00:00:00', '21', '248', null, null, null, null, '1', '10028');
INSERT INTO `biz_note` VALUES ('58', '10', '这不是真的', '76', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;你是不是傻逼<br/>&nbsp;&nbsp;&nbsp;只有你自己知道', '2015-07-15 11:54:59', '2014-09-26 00:00:00', '5', '75', null, null, null, null, '1', '10028');
INSERT INTO `biz_note` VALUES ('59', '10', '【中国射箭男子团体】爆冷5-4击败棒子进入决赛', '77', '&nbsp;&nbsp;&nbsp;&nbsp;决赛对阵马来西亚<br/>在刚刚结束的亚运会射箭男女团体半决赛中，中国男队爆冷以5-4击败实力强大的东道主韩国队，将与马来西亚队争夺冠军。中国女队6-0零封日本队，将与韩国队争夺金牌。', '2015-09-30 17:21:16', '2014-09-26 00:00:00', '1', '22', null, null, null, null, '1', '10028');
INSERT INTO `biz_note` VALUES ('60', '10', '【发现亚洲对游泳的关注】真的是亚运第一位的', '77', '那些偶尔拿块游泳奖牌的国家或地区所在国的电视台完全是以金地规格报道，好像比其他项目夺金还荣耀。<br/>各种距离，各种姿势，容易多金。<br/>', '2014-10-09 11:06:52', '2014-09-26 00:00:00', '26', '40', null, null, null, null, '1', '10028');
INSERT INTO `biz_note` VALUES ('61', '10', '【我孕】心系娜姐， 2-6 4-6憾败路人甲', '76', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;我孕接受中网外卡只是为了掩人耳目担任娜姐退役的神秘嘉宾，比利时股市准备破产吧<br/>&nbsp;&nbsp;&nbsp;&nbsp;没关系还有决赛外卡看蕴蕴能不能屈尊接受了', '2015-07-10 10:10:14', '2014-09-26 00:00:00', '4', '56', null, null, null, null, '1', '10028');
