INSERT INTO `biz_properinfo` VALUES ('13', '住宅园区虫害消杀的温馨提示', '53', '尊敬的业主/住户：<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;物业将在近期开展小区蚊蝇、蚜虫、介壳虫、卷叶虫、香烟虫的消杀工作，消杀内容主要包括将对小区的道路、空地、绿化带、喷洒药物，进行集中消杀。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;消杀地点：公共区域的垃圾桶、绿地、单元大厅等。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;消杀工作时间为2014年5月28日&nbsp;&nbsp;13:00-17：00。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;消杀药物：甲胺磷、乐果、一片净、介必治。药效为6天（如遇下雨顺延）。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;虫害消杀期间敬请注意：<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1、请业主在消杀喷雾时不要靠近喷雾。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2、请爱护好家中小孩不要接触消杀喷雾的物体。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3、请注意关好家中门窗，避免药剂味引发身体不适。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4、请不要在消杀期间触碰药剂喷洒过的绿化植被和设施设备。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;届时请您照看好儿童，看管好宠物，尽量避开药物喷洒处。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;由此给您带来的不便敬请谅解！', '10028', null, null, '1', '2014-09-26 00:00:00', '1', '2014-09-27 00:00:00', '1', null, null, null, null, null, null, null);
INSERT INTO `biz_properinfo` VALUES ('25', '万科湖心岛酒店招聘启事', '59', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;酒店占地67.8亩，酒店面积5.5K平方米，地下一层，裙房3层，地上24层，客房288套间。<br/>计划财务部现需要在筹备期招聘财务经理一名，成本主管一名，收入审计主管一名，IT主管一名，需有酒店工作经验。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;酒店可提供住宿，薪酬面议。本人承诺提供你一个和谐的工作环境和良好的学习氛围，传授你酒店财务管理的技巧和技能，量身定制你未来发展计划，助你快速成长。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;有意者，可联系我。发简历至邮箱：mydeveloper@dnake.com', '10028', null, null, '1', '2014-09-26 00:00:00', '1', '2014-09-27 00:00:00', '1', null, null, null, null, null, null, null);
INSERT INTO `biz_properinfo` VALUES ('35', '关于加强房屋出租管理相关规定的温馨知会', '54', '尊敬的住户：<br/>&nbsp;&nbsp;&nbsp;&nbsp;据厦门市纪委、市委组织部、市人事局、市监察局、市维护稳定及综治办等5部门联合制订的《关于加强私人出租屋业主监督管理的若干意见(试行)》规定，凡在xx市范围内从事房屋租赁经营的个人，在租赁关系确立后10天内，应自觉在房屋所在地租赁管理所办理合同登记或备案手续。逾期没有登记或者备案的，由租赁管理部门一次性处以合同期租金总额20%的罚款，并追缴租赁管理费、代征税款和滞纳金。<br/>&nbsp;&nbsp;&nbsp;&nbsp;房屋出租人有协助有关部门做好社会治安综合治理工作的义务，租赁关系确立后，应在3日内督促、协助承租人到出租屋综合管理机关办理租住人员信息登记，否则，由主管部门处以月租金额一倍的罚款。&nbsp;&nbsp;管理处诚请承租人能主动向花城社区警务室登记人员信息，出租人能督促、协助承租人办理登记备案手续。<br/>&nbsp;&nbsp;&nbsp;&nbsp;目前该规定意见征集期已过，不久就会和市民见面。敬请万科湖心岛小区广大住户知悉。', '10028', null, null, '1', '2014-09-26 00:00:00', '1', '2014-09-27 00:00:00', '1', null, null, null, null, null, null, null);
INSERT INTO `biz_properinfo` VALUES ('36', '温馨提示(高空抛物）', '55', '尊敬的住户：<br/>&nbsp;&nbsp;&nbsp;&nbsp;美丽的小区需要您、我、他共同的呵护，近期部分业主反映有业主高空抛物的现象严重，管理处真诚希望各位住户能够自觉遵守《文明公约》，不要高空抛物，以减少对他人生活的影响，大家共同营造温馨、文明的居住环境。<br/>&nbsp;&nbsp;&nbsp;&nbsp;非常感谢您的支持与配合！', '10028', null, null, '1', '2014-09-26 00:00:00', '1', '2014-09-27 00:00:00', '1', null, null, null, null, null, null, null);
INSERT INTO `biz_properinfo` VALUES ('37', '关于小区一期底商招商公告', '56', '尊敬的住户：<br/>&nbsp;&nbsp;&nbsp;&nbsp;万科湖心岛业主委员会于2013年4月14日14：30在会所多功能厅举行第七十二次会议。会议符合《万科湖心岛业主大会议事规则》的法定人数。<br/>&nbsp;&nbsp;&nbsp;&nbsp;会议决定向园区业主公告如下：<br/>&nbsp;&nbsp;&nbsp;&nbsp;1、原一期商业租赁宠物店、摄影室长期拖欠房屋租金，业委会、物业管理处多次催缴仍被其拒绝；业委会依据《房屋租赁合同》将房屋收回，并对其拖欠的费用通过诉讼进行追缴。目前，zz法院已受理此案，案件进入审理程序。<br/>&nbsp;&nbsp;&nbsp;&nbsp;2、业委会依据万科湖心岛2009年第三次业主大会一期业主表决通过的《关于万科湖心岛一期底商招商方案的决议案》结果将上述两处空置房屋重新对外招租。（原宠物店面积45.86平米，原摄影室43.34平米）<br/>&nbsp;&nbsp;&nbsp;&nbsp;3、招标须知<br/>&nbsp;&nbsp;&nbsp;&nbsp;1）租赁人需具备合法经营资质与要求的个人或单位；<br/>&nbsp;&nbsp;&nbsp;&nbsp;依据《zz园管理规约》，租赁人应不欠缴各项费用；<br/>&nbsp;&nbsp;&nbsp;&nbsp;2）租赁人所开设服务项目不能与现有底商服务项目相同或相近；<br/>&nbsp;&nbsp;&nbsp;&nbsp;3）租赁方经营项目须符合国家相关法律规定并取得合法营业资格且适合在住宅小区内经营的项目；<br/>&nbsp;&nbsp;&nbsp;&nbsp;4）租赁方的经营服务项目不得影响园区业主正常生活；不得违反《zz园管理规约》；<br/>&nbsp;&nbsp;&nbsp;&nbsp;5）租赁人必须系zz园业主，投标时须出示相关证明（住户证）；租赁人需同时同意《房屋租赁合同》全部条款；<br/>&nbsp;&nbsp;&nbsp;&nbsp;6）本公告有效期为10天，公告期内有意向参与竞标的个人或单位请到物业管理处客服前台进行登记，过期不候。', '10028', null, null, '1', '2014-09-26 00:00:00', '1', '2014-09-27 00:00:00', '1', null, null, null, null, null, null, null);
INSERT INTO `biz_properinfo` VALUES ('38', '关于加强文明养犬的通告', '57', '尊敬的万科湖心岛小区住户：<br/>&nbsp;&nbsp;&nbsp;&nbsp;您好！接湖里城管执法大队的通知，因万科湖心岛小区内存在违规养犬情况，思明管执法大队将于近期到小区内对无证犬、大型犬、烈性犬进行清理，万科湖心岛居委会、业委会在此特别提醒万科湖心岛小区养犬户认真遵守《厦门市限制养犬规定》，以免出现违反政府法规的行为，对他人的生活造成影响。<br/>&nbsp;&nbsp;&nbsp;&nbsp;《厦门市限制养犬规定》摘录条款如下：<br/>&nbsp;&nbsp;&nbsp;&nbsp;摘自规定第六条：市政府对犬类饲养、销售实行许可证制度，未经许可，任何单位和个人不得饲养犬、销售犬。<br/>&nbsp;&nbsp;&nbsp;&nbsp;摘自规定第九条：只允许饲养一只小型玩赏犬，不得饲养烈性犬和大型犬。<br/>&nbsp;&nbsp;&nbsp;&nbsp;摘自规定第二十五条：个人携带犬只到户外活动，必须遵守下列规定：<br/>&nbsp;&nbsp;&nbsp;&nbsp;1、为犬只佩带市城管部门制作的号牌；<br/>&nbsp;&nbsp;&nbsp;&nbsp;2、&nbsp;&nbsp;为犬只戴防护口罩；<br/>&nbsp;&nbsp;&nbsp;&nbsp;3、&nbsp;&nbsp;佩束犬链并由成人牵领、看管；<br/>&nbsp;&nbsp;&nbsp;&nbsp;4、即时清除犬只排出的粪便。<br/>&nbsp;&nbsp;&nbsp;&nbsp;摘自规定第二十七条：居民养犬不得妨害他人，犬吠影响他人正常休息时，饲养人应采取有效措施予以制止。<br/>&nbsp;&nbsp;&nbsp;&nbsp;摘自规定第三十一条：违反本规定第六条的，未取得《养犬许可证》擅自饲养犬只的，由市、区城管部门、街道办事处或公安机关按每只犬处以7000元至10000元的罚款，并没收犬只。<br/>&nbsp;&nbsp;&nbsp;&nbsp;摘自规定第三十八条：违反本规定第二十五条的，由市、区城管部门、街道办事处或公安机关责令改正，并处500元的罚款；情节严重的，没收其犬只，并由市、区城管部门吊销《养犬许可证》。<br/>&nbsp;&nbsp;&nbsp;&nbsp;摘自规定第三十九条：违反本规定第二十七条的，由市、区城管部门、街道办事处或公安机关责令改正，并处1000元的罚款；拒不改正的，没收其犬只，并由市、区城管部门吊销《养犬许可证》。<br/>&nbsp;&nbsp;&nbsp;&nbsp;另外，春季是狂犬病等疾病的高发期，请各位养犬户按规定对犬只进行疫苗注射，以确保自己和他人的安全。', '10028', null, null, '1', '2014-09-26 00:00:00', '1', '2014-09-27 00:00:00', '1', null, null, null, null, null, null, null);
INSERT INTO `biz_properinfo` VALUES ('39', '关于万科湖心岛小区上调物业费的公告', '58', '尊敬的各位业主：<br/>&nbsp;&nbsp;&nbsp;&nbsp;自2008年至今，万科湖心岛物业已经为住户提供了近五年的物业服务。在物业公司和全体业主的共同努力下，万科湖心岛已经成为马驹桥地区的宜居典范。另外，通过精专的物业服务，万科湖心岛的房屋租金及二手房交易价格提升幅度均大于周边同类小区。XX物业的服务不仅得到了业主及社会的认可，也实现了促进房产保值增值的目的。<br/>&nbsp;&nbsp;&nbsp;&nbsp;然而，近年来CPI的逐年上升，致使物料、人工、能耗等成本的逐年上涨，行业内许多物业企业或因入不敷出而纷纷弃盘，或一味控制成本、牺牲业主生活环境换取生存空间。在这样的大背景下，一些有责任的物业企业开始寻求出路，通过与业主协商、征求广大业主意见，适度提高物业服务费的理性方式来实现物业服务的有序运行。目前，北京市已有多个小区通过上调物业费解决经营困境的成功案例。<br/>&nbsp;&nbsp;&nbsp;&nbsp;万科湖心岛至今仍执行的是2008年入伙之初的物业费标准，五年来，XX物业在确保服务品质的前提下，在广大业主的支持与监督下，对流程、制度、管控等方方面面进行了多次的优化与改进，在成本控制方面作了很多努力和尝试。物业服务是最典型的劳动密集型行业，人力成本约占到总成本的60%以上，国家用工政策的调整，对于企业来说都是牵一发而动全身。国家最低工资标准的上调、社保政策的不断完善、用工稽核频次的加剧等等，每一项细小的变动，都对物业服务成本产生了较大影响。具体到万科湖心岛来说，人工成本的上升是物业费入不敷出的一个最主要因素。以保安员的工资为例：2008年入伙时，万科湖心岛保安员的工资为1140元/月，当时政府未强制要求为员工上社会保险，因此每月1140元的工资是企业对一个保安员全部人工费支出。到了2012年，保安员的月工资上涨到2800元，而且目前政府已明文强制要求为员工上社会保险且五险绑定，公司按此要求为员工每人每月支付保险费723.24元，因此目前公司为每个保安员每月的支出为3523.24元，人力成本上涨了2倍之多。为了节约成本，物业公司已经将保安人员由三班制改为两班制，在有限的费用范围内，艰难维继。<br/>&nbsp;&nbsp;&nbsp;&nbsp;2013年3月份，XX物业公司公布了上一年度物业服务收支情况及2013年度物业服务收支预算，2013年度预算显示，预计年度亏损45.98万元。为此，万科湖心岛物业公司依据《厦门市物业服务管理办法》相关条款，提议上调物业费标准。<br/>&nbsp;&nbsp;&nbsp;&nbsp;根据小区既往财务收支情况、成本上涨未来预期，同时也考虑到广大业主的承受能力，物业公司提出物业费单价提高0.3元/平米.月的方案。本次调整后，能够保障3-4年的物业收支达到基本平衡。<br/>&nbsp;&nbsp;&nbsp;&nbsp;物业公司拟于2013年7月份以书面调查问卷的形式召开万科湖心岛业主大会，就物业服务费上调事宜进行表决，届时由物业公司员工上门发放意见表，也欢迎热心业主参与、监督。<br/>&nbsp;&nbsp;&nbsp;&nbsp;感谢广大业主的理解、支持与配合。<br/>&nbsp;&nbsp;&nbsp;&nbsp;特此公告！', '10028', null, null, '1', '2014-09-26 00:00:00', '1', '2014-09-27 00:00:00', '1', null, null, null, null, null, null, null);
INSERT INTO `biz_properinfo` VALUES ('40', '小区失物招领启事', '61', '尊敬的业主/住户：<br/>&nbsp;&nbsp;&nbsp;&nbsp;您好！<br/>&nbsp;&nbsp;&nbsp;&nbsp;我司安管人员于2011年4月11日晚上十点半左右在湖里二期万科湖心岛大门口文化广场（即2-3栋间）拾到一部儿童自行车，请失主移步到万科湖心岛居住户服务中心（即管理处）认领。', '10028', null, null, '1', '2014-09-26 00:00:00', '1', '2014-09-27 00:00:00', '1', null, null, null, null, null, null, null);
INSERT INTO `biz_properinfo` VALUES ('41', '关于万科湖心岛1、2期架空层汽车位对外发售的公告', '53', '尊敬的各位业主：<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;为满足广大业主停车需求，经我司研究决定，有关xx庭1、2期架空层汽车位对外发售事宜，现公告如下：<br/>一、万科湖心岛1、2期架空层汽车位现已对外公开发售，现已租赁1、2期架空层汽车位的业主，均有优先购买权，但须于2014年11月20日前到售楼部办理认购手续。<br/>二、如2014年11月20日后，仍未到售楼部办理认购的，我司将相关车位对外进行发售。如个别业主不愿购买架空汽车位，但已办理租赁手续的，则在约定的期限内退让予其他已办理认购的业主。<br/>三、凡是在2014年11月20日前到售楼部办理认购架空层汽车位的业主，均可获得足金金狗一只及现金优惠2000元。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;以上发售及优惠，先到先得，恭候光临！<br/>销售热线：8888000<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;特此公告', '10028', null, null, '1', '2014-09-26 00:00:00', '1', '2014-09-27 00:00:00', '1', null, null, null, null, null, null, null);
INSERT INTO `biz_properinfo` VALUES ('42', '物业管理投放鼠药温馨提示', '53', '关于小区内投放鼠药的通知:<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;接厦门环卫所通知,近期将统一对湖里区进行大面积投放鼠药,进行大面积灭鼠行动,我们x花园投放鼠药的时间为:12月14日下午,投放的主要区域为:小区的公共绿化带、小区楼宇的公共区域、小区楼层内的公共区域、垃圾桶。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;为了确保广大业主的自身安全,请在这段时间内储存好自己的食用物品,发现被鼠类咬过的食物要及时丢弃。请照看好自己的小孩,注意个人卫生并看管好自己的宠物。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;此次投放的鼠药为政府统一发放并同时投放,药物形状为带壳的稻谷,对环境无污染。希望广大业主积极配合此次灭鼠行动,发现死鼠或有异味的地方及时向我们管理处汇报。请不要私自处理死鼠,更不要将死鼠仍到垃圾箱内。我们将对死鼠进行统一销毁。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;本次行动为你和你的家人带来的不便,敬请你的谅解!<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;我们管理处不承担任何行动带来的任何损失。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;小区的环境卫生需要广大业主的共同配合与维护;谢谢!', '10028', null, null, '1', '2014-09-27 00:00:00', '1', '2014-09-27 00:00:00', '1', null, null, null, null, null, null, null);
