INSERT INTO `biz_properinfo` VALUES ('167', '关于举行消防演习的通知', '54', '<p><span style=\"font-size:14px;font-family:宋体\">尊敬的业主</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">/</span><span style=\"font-size:14px;font-family: 宋体\">住户</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">: <br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">根据上级机关文件指示精神</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">保障小区设施设备及业主人身、财产的安全</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">;</span><span style=\"font-size:14px;font-family: 宋体\">为增强我管理区域护卫人员素质及全体员工的消防意识</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">提高员工抗御初期火灾的能力</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">我管理处特定于</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">2015</span><span style=\"font-size:14px;font-family: 宋体\">年</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">03</span><span style=\"font-size:14px;font-family: 宋体\">月</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">27</span><span style=\"font-size:14px;font-family: 宋体\">日在本小区停车场举行消防演习</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">欢迎各位业主</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">/</span><span style=\"font-size:14px;font-family: 宋体\">住户到场观摩。</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"> <br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">特此通知</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">!&nbsp;</span></p>', '10028', null, null, null, '2015-08-06 10:43:07', null, '2015-03-24 09:56:01', '-1', '2015-03-24 09:56:01', '33', '2015-03-24 02:03:00', null, '0', '7cb4287b-86cc-4ef9-b583-e230aace61f7', '35020601990001');
INSERT INTO `biz_properinfo` VALUES ('168', '关于天气变化的温馨提示', '54', '<p><span style=\"font-size:14px;font-family:宋体\">尊敬的业主</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">(</span><span style=\"font-size:14px;font-family: 宋体\">住户</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">): <br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">您好</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">! <br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">近阶段时期</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">气温变化较大</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">请注意服装填减</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">以防疾病。夏季即将来临</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">风雨、雷电天气可能会频繁出现</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">希望各位业主注意自身身体健康外</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">对居室中放置在阳台、窗台的杂物</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">如花盆、晾晒的衣物等请妥善放置</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">避免在刮大风时丢失、砸伤行人或毁坏其他物品</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">雷电时请注意保护好您家中的电器。在外出时切记检查家中水管、电器、煤气、门窗是否关好</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">以避免安全隐患。</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"> <br/> <br/> </span></p>', '10028', null, null, null, '2015-08-06 10:43:07', null, '2015-01-24 09:57:26', '-1', '2015-01-24 09:57:26', '35', '2015-03-24 02:03:00', null, '0', '7f29749e-63c3-4fba-9518-35633c16febb', '35020601990001');
INSERT INTO `biz_properinfo` VALUES ('169', '消 杀 通 知 ', '54', '<p>尊敬的广大业主/住户：为保障小区环境优美，营造健康的物业家园，管理处将安排对小区公共区域进行全面的喷药消杀。 &nbsp;&nbsp;</p>', '10028', null, null, null, '2015-08-06 10:43:08', null, '2015-01-23 17:08:57', '-1', '2015-01-23 17:08:57', '29', '2015-02-26 02:03:00', null, '0', '50be8477-0ddd-43ef-ae27-92b520b4e4c0', '35020601990001');
INSERT INTO `biz_properinfo` VALUES ('170', '关于缴纳物业费的通知', '54', '<p>尊敬的各位业主： &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp; 您好！根据《物业管理条例》《物权法》以及《业主公约》的相关规定，2014年度缴纳物业费工作已经开始，按时缴纳物业费是每位业主的义务，也是物业公司维持日常运营的基本保障。物业费是小区公共秩序维护、环境卫生、公共区域维修，以及电梯、配电、公共照明等设备设施正常运转的根本保障。如您不能按时足额交纳物业费，将会对小区物业管理服务工作造成严重的影响。同时，也侵犯了已交费业主的切身利益。 &nbsp;</p><p>&nbsp; &nbsp; &nbsp;若有不明，请致电物业客服中心咨询：81870926我司将随时接受业主的监督，持续改进工作方法，提升服务品质，竭诚为业主服务。感谢您的理解与支持！&nbsp;</p>', '10028', null, null, null, '2015-08-06 10:43:08', null, '2015-01-23 17:07:13', '-1', '2015-01-23 17:07:13', '28', '2015-01-23 02:03:00', null, '0', '1a5d759e-4a03-47f4-bb57-947cb1cce94c', '35020601990001');
INSERT INTO `biz_properinfo` VALUES ('171', '元旦节放假的温馨提示', '54', '<p><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">&nbsp;</span><span style=\"font-size: 14px;font-family:宋体\">尊敬的各位业主</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">/</span><span style=\"font-size:14px;font-family:宋体\">住户</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">: <br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">您好</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">! <br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">新年将至</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">我公司恭祝大家新年快乐</span><span style=\"font-size: 14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">万事如意</span><span style=\"font-size: 14px;font-family:&#39;ˎ̥&#39;,serif\">!</span><span style=\"font-size:14px;font-family:宋体\">为了大家能过一个安全、温馨和舒适的节日</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">我公司在加强各小区出入口控制和日常巡逻的同时提醒各位业主和住户</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">: <br/> &nbsp;&nbsp;&nbsp; 1</span><span style=\"font-size:14px;font-family:宋体\">、如您外出</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size: 14px;font-family:宋体\">注意关好门窗以及水、电、气的开关</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">同时请保管好自己的贵重物品</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">不要将大额现金留存家中</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">以免发生火灾和失窃。</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"> <br/> &nbsp;&nbsp;&nbsp; 2</span><span style=\"font-size:14px;font-family:宋体\">、请您将车辆停放在指定位置</span><span style=\"font-size: 14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">并检查确认车门车窗是否完全锁住</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">以免造成经济损失</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">;</span><span style=\"font-size:14px;font-family:宋体\">如您长时间外出</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">而车辆停放在小区内</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">请及时告之管理处。</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"> <br/> &nbsp;&nbsp;&nbsp; 3</span><span style=\"font-size:14px;font-family:宋体\">、请不要随意给陌生人开门</span><span style=\"font-size: 14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">以防不测。</span><span style=\"font-size: 14px;font-family:&#39;ˎ̥&#39;,serif\"> <br/> &nbsp;&nbsp;&nbsp; 4</span><span style=\"font-size:14px;font-family:宋体\">、在使用家用电器及天然气时</span><span style=\"font-size: 14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">请注意用电用火安全</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">切勿违规操作。</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"> <br/> &nbsp;&nbsp;&nbsp; 5</span><span style=\"font-size:14px;font-family:宋体\">、请大家将自家阳台上摆放的物品移至安全地方</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">以避免高空坠物</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">;</span><span style=\"font-size:14px;font-family:宋体\">同时也请楼上住户不要将物品向楼下丢弃</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">以免伤及楼下行人及车辆和影响小区的卫生状况。</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"> <br/> &nbsp;&nbsp;&nbsp; 6</span><span style=\"font-size:14px;font-family:宋体\">、根据派出所要求</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">商铺的商家在节日期间如要歇业</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">店内请留人值守</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">(</span><span style=\"font-size:14px;font-family:宋体\">特别在夜间</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">),</span><span style=\"font-size:14px;font-family:宋体\">营业结束后不要将贵重物品</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">(</span><span style=\"font-size:14px;font-family:宋体\">如电脑等物</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">)</span><span style=\"font-size:14px;font-family:宋体\">放置在店面上</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">以防失窃。</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"> <br/> &nbsp;&nbsp;&nbsp; 7</span><span style=\"font-size:14px;font-family:宋体\">、请照看好自己的小孩</span><span style=\"font-size: 14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">不要在水池边玩耍及在小区内燃放烟花爆竹</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">预防溺水及火灾事件的发生。</span></p>', '10028', null, null, null, '2015-08-06 10:50:30', null, '2015-01-01 09:55:14', '-1', '2015-01-01 09:55:14', '32', '2015-03-24 02:03:00', null, '0', '937e7d40-0cd5-47b8-a680-cff5919a1501', '35020601990001');
INSERT INTO `biz_properinfo` VALUES ('172', '温馨提示——请注意厨房用火安全', '54', '<p><span style=\"font-size:14px;font-family:宋体\">某小区业主在做饭时</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">将油倒入锅中点燃天然气便离开厨房到外屋接听电话</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">由于长时间未返回厨房处理</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">导致锅内菜油加热过度引发燃烧</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">业主发现后发出惊呼</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">该小区物业公司工作人员立即持灭火器迅速赶往现场紧急处置。在大家的共同努力下</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">及时排除了险情。这一幕不是电影中的场景</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">而是前两天某小区刚发生的一起失火事件。该小区相关领导也在第一时间内赶到现场</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">向业主询问了具体情况</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">及时对业主情绪进行了安抚</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">安排</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"><a href=\"http://www.fdcew.com/hypx/List_190.html\" target=\"_blank\"><span style=\"font-family:宋体;color:windowtext;text-underline: none\">保洁</span></a></span><span style=\"font-size:14px;font-family:宋体\">员协助业主对失火房间进行了清理。物业公司工作人员在对该户业主厨房进行检查时发现</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">:</span><span style=\"font-size:14px;font-family: 宋体\">燃气灶胶管烧坏</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">气灶上方一块玻璃破损</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">其它均无损失。此次失火事件虽未给业主造成较大的损失</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">但着实让人后怕。在此我们提醒各位</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">:</span><span style=\"font-size:14px;font-family: 宋体\">请注意厨房用火安全</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">: <br/> &nbsp;&nbsp;&nbsp; 1</span><span style=\"font-size:14px;font-family:宋体\">、</span> <span style=\"font-size:14px;font-family: 宋体\">定期检查煤气管道接头是否漏气</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">; <br/> &nbsp;&nbsp;&nbsp; 2</span><span style=\"font-size:14px;font-family:宋体\">、</span> <span style=\"font-size:14px;font-family: 宋体\">外出时请务必确认煤气阀门是否关闭</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">; <br/> &nbsp;&nbsp;&nbsp; 3</span><span style=\"font-size:14px;font-family:宋体\">、</span> <span style=\"font-size:14px;font-family: 宋体\">发现异常情况请及时报修</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">发生紧急情况请及时报警</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">; <br/> &nbsp;&nbsp;&nbsp; 4</span><span style=\"font-size:14px;font-family:宋体\">、</span> <span style=\"font-size:14px;font-family: 宋体\">煤气灶处于明火状态时请勿离开厨房。</span></p>', '10028', null, null, null, '2015-08-06 10:50:30', null, '2014-12-03 09:58:11', '-1', '2014-12-03 09:58:11', '37', '2015-03-24 02:03:00', null, '0', '9422805b-2c14-420f-93e8-eb909aa91753', '35020601990001');
INSERT INTO `biz_properinfo` VALUES ('173', '关于电梯使用的温馨提示', '54', '<p style=\"line-height: 180%;background: white\"><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">&nbsp;</span><span style=\";line-height:180%;font-family:宋体\">尊敬的各位业主及各装修单位</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">: <br/> &nbsp;&nbsp;&nbsp; </span><span style=\";line-height: 180%;font-family:宋体\">为了确保电梯的合理使用、正常运行和大厦物业的有序管理。请遵守大厦电梯管理规定</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">: <br/> &nbsp;&nbsp;&nbsp; 1</span><span style=\";line-height: 180%;font-family:宋体\">、一号和二号为客用电梯</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\";line-height:180%;font-family:宋体\">行人请使用此电梯</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">; <br/> &nbsp;&nbsp;&nbsp; 2</span><span style=\";line-height: 180%;font-family:宋体\">、三号电梯为货运电梯</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\";line-height:180%;font-family:宋体\">货物运输请使用此电梯</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">; <br/> &nbsp;&nbsp;&nbsp; 3</span><span style=\";line-height: 180%;font-family:宋体\">、请遵守规定的乘坐人数和承载重量</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\";line-height:180%;font-family:宋体\">超载时警报鸣响</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\";line-height:180%;font-family:宋体\">轿门不会关闭</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\";line-height:180%;font-family:宋体\">因此</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\";line-height:180%;font-family:宋体\">请最后搭乘的客人退出或卸载超重货物</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">; <br/> &nbsp;&nbsp;&nbsp; 4</span><span style=\";line-height: 180%;font-family:宋体\">、在轿厢内蹦跳时有可能使安全装置动作</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\";line-height:180%;font-family:宋体\">电梯在途中停止运行</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\";line-height:180%;font-family:宋体\">造成故障的原因</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\";line-height:180%;font-family:宋体\">因此请静静乘用</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">; <br/> &nbsp;&nbsp;&nbsp; 5</span><span style=\";line-height: 180%;font-family:宋体\">、请勿随意或乱按候梯厅或轿厢内的按钮</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">; <br/> &nbsp;&nbsp;&nbsp; 6</span><span style=\";line-height: 180%;font-family:宋体\">、电梯内禁止吸烟</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\";line-height:180%;font-family:宋体\">为了乘用电梯时</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\";line-height:180%;font-family:宋体\">心情愉快</span><span style=\";line-height:180%;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\";line-height:180%;font-family:宋体\">请遵守规定</span></p><p><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">7</span><span style=\"font-size:14px;font-family: 宋体\">、开闭电梯时</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">有危险</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">请注意勿碰到门或依靠门边站立</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">; <br/> &nbsp;&nbsp;&nbsp; 8</span><span style=\"font-size:14px;font-family:宋体\">、有幼儿搭乘时</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">必须有保护者在场</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">; <br/> &nbsp;&nbsp;&nbsp; 9</span><span style=\"font-size:14px;font-family:宋体\">、火灾、地震时的避难</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">请勿使用电梯。</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"> <br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">爱护公物人人有责</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">请各位业主及装修单位遵守大厦电梯管理规定</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">配合我们的管理工作</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">!&nbsp;</span></p><p><br/></p>', '10028', null, null, null, '2015-08-06 10:50:31', null, '2014-08-21 09:57:46', '-1', '2014-08-21 09:57:46', '36', '2015-03-24 02:03:00', null, '0', 'cfc7c045-4337-4fb6-9b61-15af61e46c27', '35020601990001');
INSERT INTO `biz_properinfo` VALUES ('174', '高空抛物温馨提示', '54', '<p><span style=\"font-size:14px;font-family:宋体\">尊敬的业主</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">/</span><span style=\"font-size:14px;font-family: 宋体\">住户</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">:<br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">近期管理服务中心接到业主</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">/</span><span style=\"font-size:14px;font-family: 宋体\">住户反映</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">有人从楼上向下扔杂物、烟头等</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">此不良行为严重危及他人安全。</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"><br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">为杜绝类似事件发生</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">敬请各业主</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">/</span><span style=\"font-size:14px;font-family: 宋体\">住户不要高空抛物</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">您的细心大家齐安心。</span></p>', '10028', null, null, null, '2015-08-06 10:50:31', null, '2014-06-10 09:58:35', '-1', '2014-06-10 09:58:35', '38', '2015-03-24 02:03:00', null, '0', 'd09c334e-1039-4309-80f9-f1806d2646b4', '35020601990001');
INSERT INTO `biz_properinfo` VALUES ('175', '小区关于办理业主卡的通知', '54', '<p><span style=\"font-size:14px;font-family:宋体\">尊敬的住户</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">:<br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">你们好</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">!</span><span style=\"font-size:14px;font-family: 宋体\">现本小区已进入装修阶段</span><span style=\"font-size: 14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">进出苑区人员日益增多</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">管理处为加强小区人员进出管理</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">确保苑区的安全和谐</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">须对苑区住户办理业主卡</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">住户须凭业主卡进出苑区。请业主于近期内到管理处办理</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family:宋体\">谢谢合作</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">!<br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">办理业主卡需带资料</span><span style=\"font-size: 14px;font-family:&#39;ˎ̥&#39;,serif\">:<br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">一、业主及家人</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">:<br/> &nbsp;&nbsp;&nbsp; 1</span><span style=\"font-size:14px;font-family:宋体\">寸照片</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">2</span><span style=\"font-size:14px;font-family: 宋体\">张</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">身份证复印件</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">1</span><span style=\"font-size:14px;font-family: 宋体\">张</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"><br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">二、租住户</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">:<br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">租房</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"><a href=\"http://www.fdcew.com/gw/List_211.html\" target=\"_blank\"><span style=\"font-family:宋体;color:windowtext;text-underline: none\">合同</span></a></span><span style=\"font-size:14px;font-family:宋体\">复件</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">;</span><span style=\"font-size:14px;font-family: 宋体\">身份证复件</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">1</span><span style=\"font-size:14px;font-family: 宋体\">份</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">;1</span><span style=\"font-size:14px;font-family: 宋体\">寸照片</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">2</span><span style=\"font-size:14px;font-family: 宋体\">张</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"><br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">三、公司员工</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">: <br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">租房合同复件</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">(</span><span style=\"font-size:14px;font-family: 宋体\">限租住户</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">);</span><span style=\"font-size:14px;font-family: 宋体\">公司营业执照复件</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">1</span><span style=\"font-size:14px;font-family: 宋体\">份</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">;</span><span style=\"font-size:14px;font-family: 宋体\">公司介绍信</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">;</span><span style=\"font-size:14px;font-family: 宋体\">身份证复件</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">1</span><span style=\"font-size:14px;font-family: 宋体\">张</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">;1</span><span style=\"font-size:14px;font-family: 宋体\">寸照片</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">2</span><span style=\"font-size:14px;font-family: 宋体\">张。</span></p>', '10028', null, null, null, '2015-08-06 11:03:33', null, '2014-03-24 09:54:02', '-1', '2014-03-24 09:54:02', '31', '2015-03-24 02:03:00', null, '0', '828349e2-13a3-4728-98e5-505776a2b645', '35020601990001');
INSERT INTO `biz_properinfo` VALUES ('176', '关于机动车停车卡使用办法的通知', '54', '<p><span style=\"font-size:14px;font-family:宋体\">尊敬的车主</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">: <br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">您好</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">!</span><span style=\"font-size:14px;font-family: 宋体\">为了能对小区内的机动车实行</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"><a href=\"http://www.fdcew.com/Soft/kfsj/\" target=\"_blank\"><span style=\"font-family:宋体;color:windowtext;text-underline: none\">规范</span></a></span><span style=\"font-size:14px;font-family:宋体\">化的管理</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">我管理处提醒各位车主</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">:</span><span style=\"font-size:14px;font-family: 宋体\">如果您办了月租</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">那您手中的月卡就是凭证</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">请在进出大门时候一定要交给护卫查验。如不能出示月卡</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">那只能视为临停收费。同时</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">如果您的月租到期了</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">请及时到管理处办理手续</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">逾期未办理手续的车辆</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">当您进出小区时我们将按临停收费。护卫在您进小区时将给您开具</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">“</span><span style=\"font-size:14px;font-family: 宋体\">进出凭条</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">”,</span><span style=\"font-size:14px;font-family: 宋体\">此条是您车辆进出小区的重要凭证</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">因此请车主保管好该凭条。如果您不小心遗失了</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">为了您的车辆安全</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">请及时通知管理处</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">并到管理处办理遗失手续。我管理处将严格按照此规定检查月卡和凭条</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">由此给您带来的不便</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">深表歉意</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">,</span><span style=\"font-size:14px;font-family: 宋体\">谢谢您的合作</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\">! <br/> &nbsp;&nbsp;&nbsp; </span><span style=\"font-size:14px;font-family:宋体\">特此通知</span><span style=\"font-size:14px;font-family:&#39;ˎ̥&#39;,serif\"> <br/> </span></p>', '10028', null, null, null, '2015-08-06 11:03:34', null, '2014-01-08 09:56:50', '-1', '2014-01-08 09:56:50', '34', '2015-03-24 02:03:00', null, '0', 'baaf84d7-c4ec-468b-961d-ec088877cef8', '35020601990001');
